import { createDrawerNavigator } from '@react-navigation/drawer';
import React from 'react';
import MowSidebar from '../../components/ui/Core/Sidebar/MowSidebar';
import { HomeNavigator } from '../home/home.navigator';
import { SearchNavigator } from '../search/search.navigator';
import { CategoriesNavigator } from '../category/categories.navigator';
import { DepartmentsNavigator } from '../category/departments.navigator';
import { SubCategoriesNavigator } from '../category/subCategories.navigator';
import { CategoryDetailsNavigator } from '../category/categoryDetails.navigator';
import { CartNavigator } from '../cart/cart.navigator';
import { OrdersNavigator } from '../orders/orders.navigator';
import { OrderDetailsNavigator } from '../orders/orderDetails.navigator';
import { ProductListNavigator } from '../product/productList.navigator';
import { ProductDetailsNavigator } from '../product/productDetails.navigator';
import { ProductFilterNavigator } from '../product/productFilter.navigator';
import { BillingAddressNavigator } from '../cart/billingAddress.navigator';
import { ShippingAddressNavigator } from '../cart/shippingAddress.navigator';
import { DeliveryTimingNavigator } from '../cart/deliveryTiming.navigator';
import { PaymentMethodNavigator } from '../cart/paymentMethod.navigator';
import { ProfileNavigator } from '../account/profile.navigator';
import { MembershipNavigator } from '../account/membership.navigator';

const Drawer = createDrawerNavigator();

export const MainNavigator = (): React.ReactElement => (
  <Drawer.Navigator
    screenOptions={{ gestureEnabled: false }}
    drawerStyle={{ width: '80%' }}
    drawerContent={props => <MowSidebar {...props} />}>
    <Drawer.Screen name='Home' component={HomeNavigator} />
    <Drawer.Screen name='Search' component={SearchNavigator} />
    <Drawer.Screen name='Departments' component={DepartmentsNavigator} />
    <Drawer.Screen name='Categories' component={CategoriesNavigator} />
    <Drawer.Screen name='SubCategories' component={SubCategoriesNavigator} />
    <Drawer.Screen name='BillingAddress' component={BillingAddressNavigator} />
    <Drawer.Screen name='ShippingAddress' component={ShippingAddressNavigator} />
    <Drawer.Screen name='DeliveryTiming' component={DeliveryTimingNavigator} />
    <Drawer.Screen name='PaymentMethod' component={PaymentMethodNavigator} />
    <Drawer.Screen name='Profile' component={ProfileNavigator} />
    <Drawer.Screen name='Membership' component={MembershipNavigator} />

    <Drawer.Screen name='CategoryDetails' component={CategoryDetailsNavigator} />
    <Drawer.Screen name='Cart' component={CartNavigator} />
    <Drawer.Screen name='Orders' component={OrdersNavigator} />
    <Drawer.Screen name='OrderDetails' component={OrderDetailsNavigator} />
    <Drawer.Screen name='ProductList' component={ProductListNavigator} />
    <Drawer.Screen name='ProductDetails' component={ProductDetailsNavigator} />
    <Drawer.Screen name='ProductFilter' component={ProductFilterNavigator} />
  </Drawer.Navigator>
);
